import { Grid, makeStyles, Typography } from '@material-ui/core'
import React from 'react'

function Restaurant(props) {
    const useStyles = makeStyles(theme => ({
        background: {
            height: '320px',
            width: '240px',
            borderColor: theme.palette.primary.light,
            borderRadius: '10px',
            border: '3px solid',
            marginTop: '30px',
            backgroundColor: 'white',
            marginRight:'auto',
            marginLeft:'auto',
            textAlign:'center',


        },
        title: {
            ...theme.typography.title,
            marginTop:'10px'
        },
        dummyImage:{
            height:'150px',
            width:'190px',
            backgroundColor:'grey',
            marginRight:'auto',
            marginLeft:'auto',
            marginTop:'10px',
            borderRadius:'5px'
        }
    }))
    const classes = useStyles()
    return (
        <div className={classes.background} >
            {props.image ? (<div></div>) : (
            <div className={classes.dummyImage} ></div>)}
            <Typography variant='h5' noWrap className={classes.title} >{props.name}</Typography>
            <Typography variant='p'  className={classes.title} >{props.address}</Typography>
            <Typography variant='p'  className={classes.title} >{props.city}</Typography>
            <Typography variant='p' noWrap className={classes.title} >{props.state}</Typography>
        </div>
    )
}

export default Restaurant
